Intermediates for heterocyclic compounds having fungicidal or plant growth regulatory activity are compounds having the general formula (II):
   and stereoisomers thereof, wherein: 
Q is phenyl or aralkyl having one to four carbon atoms in the alkyl moiety, optionally substituted with one or more substituents selected from halogen, haloalkyl, C 1-4 alkyl, C 1-4  alkoxy, phenyl and phenoxy; 
or Q is C 1-6 alkyl; 
R², R³, R⁴, R⁵ and R⁶, which may be the same or different, is each H, C 1-6 alkyl, C 3-6 cycloalkyl, or is phenyl or aralkyl having one to four carbon atoms in the alkyl moiety, optionally substituted with one or more substituents selected from halogen, haloalkyl, C 1-4 alkyl, C 1-4 alkoxy, phenyl and phenoxy; and 
R⁷ and R⁸, which may be the same or different, are alkyl or alkenyl groups or together form a ring. Other compounds and their use in preparing compounds of general formula (II) are described.

Intermediates for heterocyclic compounds having fungicidal or plant growth regulatory activity are compounds having the general formula (II):
   and stereoisomers thereof, wherein: 
Q is phenyl or aralkyl having one to four carbon atoms in the alkyl moiety, optionally substituted with one or more substituents selected from halogen, haloalkyl, C 1-4 alkyl, C 1-4  alkoxy, phenyl and phenoxy; 
or Q is C 1-6 alkyl; 
R², R³, R⁴, R⁵ and R⁶, which may be the same or different, is each H, C 1-6 alkyl, C 3-6 cycloalkyl, or is phenyl or aralkyl having one to four carbon atoms in the alkyl moiety, optionally substituted with one or more substituents selected from halogen, haloalkyl, C 1-4 alkyl, C 1-4 alkoxy, phenyl and phenoxy; and 
R⁷ and R⁸, which may be the same or different, are alkyl or alkenyl groups or together form a ring. Other compounds and their use in preparing compounds of general formula (II) are described.

Compounds having the general formula (I):
  and stereoisomers thereof, wherein: Q is phenyl or aralkyl having one to four carbon atoms in the alkyl moiety, optionally substituted with one or more substituents selected from halogen, haloalkyl, C 1-4 alkyl, C 1-   4 alkoxy, phenyl and phenoxy; or  
Q is C 1-6 alkyl;  
 R 2 , R 3 , R 4 , R 5  and R 6 , which may be the same or different, is each H, C 1-6 alkyl, C 3-6 cycloalkyl, or is phenyl or aralkyl having one to four carbon atoms in the alkyl moiety, optionally substituted with one or more substituents selected from halogen, haloalkyl, C 1-4 alkyl, C 1-4 alkoxy, phenyl and phenoxy;  
and acid salts and metal complexes thereof, have plant growth regulatory and fungicidal activity.
